import React    from 'react';
import Button   from 'react-bootstrap/Button';
import Navbar   from 'react-bootstrap/Navbar';
import Nav      from 'react-bootstrap/Nav';
import Form from 'react-bootstrap/Form'
import { Link } from 'react-router-dom';
import styles   from './Navbar.css';
import logo from 'github_logo.svg';

class NavBar extends React.Component {

    state = {}
    constructor(props) { super(props) }

    render() {
        return (
            <Navbar variant="dark" className="navy-bg">
                <Navbar.Brand href="/Home">Navbar</Navbar.Brand>
                <Nav className="mr-auto ">
                    <Nav.Link href="/Home">Home</Nav.Link>
                    <Nav.Link href="/resume">R&eacute;sum&eacute;</Nav.Link>
                    <Nav.Link href="/contact">Contact Me</Nav.Link>
                    <Nav.Link href="/howitsmade">How It's Made</Nav.Link>
                </Nav>
                {/*
                <Form inline>
                    <Form.Control type="text" placeholder="Search" className="mr-sm-2" />
                    <Button variant="outline-light">Search</Button>
                </Form
                */}
                <a target="_blank" rel="noopener noreferrer" href="https://github.com/CarlosCarras" data-rb-event-key="https://github.com/CarlosCarras" className="nav-link">
                    <svg data-icon="github" role="img" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 496 512" >

                    </svg>
                </a>
            </Navbar>
        )
    }
}

export default NavBar
